import Home from './components/Home';
import {Route, BrowserRouter,Switch,Redirect } from 'react-router-dom';
import SingIn from './components/SigninJs';
import CreataccountCard from './components/CreatUser';

import { useContext } from "react";
import { AuthContext } from "./context/AuthContext";

export default function App(props) {
  const { user } = useContext(AuthContext);

  return (
   <BrowserRouter>
      <Switch>
        <Route exact path="/">
          { user ? <Redirect to="/home" /> : <SingIn />}
        </Route>
        <Route path="/home">{!user ? <Redirect to="/" /> : <Home socket={props.socket}/>}</Route>
        <Route path="/CreatUser" component={CreataccountCard} />
      </Switch>
    </BrowserRouter>
  );
}
